import { AiOutlineMenu } from 'react-icons/ai';
import classes from '../Components.module.css';
import { MdPermIdentity } from 'react-icons/md';
import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    <div>
      <div className={classes.navMenu}>
        <AiOutlineMenu className={classes.menu_bars} />
        <h1>Grocelist</h1>
        <div className={classes.nav_end}>
          <MdPermIdentity className={classes.ProfileIcon} />
          <h3>Profile</h3>
        </div>
      </div>
      <nav className={classes.nav_menu_active}>
        <ul className={classes.nav_menu_items}>
          <li>Grocery</li>
          <li>Personal Todos</li>
          <li>Groups</li>
        </ul>
      </nav>
    </div>
  );
};
export default Navbar;
